      {trackAlbums.map((album, i) => albums[i] = album)}
      {trackArtists.map((artists, i) => artists[i] = artists)}
      {trackAlbumCoverUrls.map((url, i) => urls[i] = url)}
  
  const albums = []
  
  const artists = []
  
  const urls = []
  

  return (
    <div style={{marginLeft: 10}}>
      
      <h1>And here they are:</h1>
      <TrackDisplay 
        trackName={names[0]} 
        trackAlbumCoverUrl={albums[0]} 
        trackAlbum={artists[0]} 
        trackArtists={urls[0]} 
      />
